import { Link } from 'react-router-dom'
import './home.css';
const Nav = () => {
    return (
        <>
            <section class="header">
                <div class="text-box ">
                    <img src='https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQoz5EsxkCxABa_jDWBLefFGaboh3YpKYhs28VbhXLEXz4op8pyy6cfYghQI0qBHMUt-CE&usqp=CAU' />

                </div>
            </section>
        </>
    )
}

export default Nav
